     height : 220px;
     background-color: #00bfa5;
     box-shadow: none;
`

const Messenger = ()=>{
    return(
        <Component>
        <Header>
            <Toolbar>

            </Toolbar>
        </Header>
        <LoginDialog/>
        </Component>
    )
}

export default Messenger;
